import React, { useState } from 'react';
import { useMutation } from '@apollo/client';
import { gql } from 'apollo-boost';

const SUBMIT_FORM_MUTATION = gql`
  mutation SubmitForm($input: FormInputType!) {
    createForm(input: $input) {
      id
      field1
      field2
    }
  }
`;

const Form = () => {
  const [formState, setFormState] = useState({ field1: '', field2: '' });
  const [createForm, { data }] = useMutation(SUBMIT_FORM_MUTATION);

  const onSubmit = async (event) => {
    event.preventDefault();
    try {
      const { data } = await createForm({ variables: { input: formState } });
      console.log(data);
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      <input
        value={formState.field1}
        onChange={(e) =>
          setFormState({ ...formState, field1: e.target.value })
        }
      />
      <input
        value={formState.field2}
        onChange={(e) =>
          setFormState({ ...formState, field2: e.target.value })
        }
      />
      <button type="submit">Submit</button>
    </form>
  );
};

export default Form;
```
In this example, we are using the `useMutation` hook from the `@apollo/client` library to send a mutation to our GraphQL API. The mutation is defined in the `SUBMIT_FORM_MUTATION` constant and takes in a single variable `input` of type `FormInputType!`. The mutation will create a new form with the provided input fields.

The `useMutation` hook returns an array with the first element being the mutation function and the second element being an object that contains the data returned from the mutation. We are using object destructuring to extract these values and storing the mutation function in the `createForm` variable and the data object in the `data` variable.

The `onSubmit` function is called when the form is submitted. It first prevents the default form submission behavior and then calls the `createForm` mutation function with the `formState` as the input variable

